file_path = open('./TestInputData/TestInputData.txt','r')

def replace_duplicates(input_file):

    with open(input_file,"r") as fin:
        output = []
        for line in fin:
            if line not in output:
                output.append(line)
                print(line)
            else:
                line = line.replace(" ","+")
                output.append(line)
                print(line)
        return output



def get_words(input_file):
    out = {}
    with open(input_file,"r") as fin:
        for line in fin:
            if line.startswith(" "):
                continue
            out[line[0]] = line
    return out


for item in get_words(file_path):
    print(item[0],"is",item[1],"in",item[0])</s>

